    set module = ##class(%ZPM.PackageManager.Developer.Module).NameOpen("zpm")
    if '$ISOBJECT(module) {
      RETURN 1
    }

    set version = ##class(%ZPM.PackageManager.Core.SemanticVersion).FromString(..#VERSION)
